import React from "react";
import './Accord.css'
import Api from './api'
import Button from '@material-ui/core/Button'

const Accord = (()=>{
  return (<>
        <Button>hii</Button>
        <div>
          {Api.map((values ,index)=>{
              return <h1>{index+1}.{values.question}</h1>
          })}
        </div>
  </>)  
})
export default Accord
